package basic;
import java.util.*;
public class P1072 {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc=new Scanner(System.in);
		int n=sc.nextInt();
		int arr[]=new int[n];
	
		for(int i=0;i<n;i++) {
			arr[i]=sc.nextInt();
			System.out.println(arr[i]);
		}
		sc.close();
		return;
	}
}
